scriptlet.script:
data=ACHCCommentList;

function addNewlines(str) {
  var result = '';
  while (str.length > 0) {
    result += str.substring(0, 65) + '\\t\\t\\t';
    str = str.substring(65);
  }
  return result;
}

var ACHCCommentList = addNewlines(ACHCCommentList)


// You can also place data into the local context, which means it will only be available to 
// the current flow, but not to its parent flow or other subflows.  To do this: 
scriptletContext.put("ACHCCommentList",ACHCCommentList);
